import MenuContainerButton from "./MenuContainerButton";

export default function MenuContainer(onButtonClick,{newMenuItems}) {
    let elementsList = newMenuItems.map((menuItem) => {
        return <MenuContainerButton
            key={menuItem.id}
            {...menuItem}
            onCLick={() => onButtonClick(menuItem.id)}
        />
    })

    return (
        <div className="menu-container">
            <ul className="ul-menu-list" role="list">
                {elementsList}
            </ul>
        </div>
    )
}
